            <li className="close">
                <img src={Close} alt="" width="20"/>
            </li>
        </ul>
        <div className="nav-cart">
            <span>0</span>
            <Link to='/cart'>
                <img src={CartIcon} alt="" width="20"/>
            </Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
